export default function TeamProfile(props){
    return(
        <div>
            <img src={props.img} alt={props.alt} />
            <p className="name">{props.name} </p>
            <p className="title">{props.title} </p>
            <style jsx>
                {`
                    div{
                        display:flex;
                        flex-direction:column;
                        justify-content: center;
                        align-items:center;
                        background:white;
                        color: var(--main-color);
                        width:200px;
                    }
                    img{
                        height:100px;
                        width:100px;
                        border-radius:50%;
                        box-shadow: 0px 3px 6px #000;
                        margin: 1rem;
                    }

                    .name{
                        font-size: 1.4rem;
                        font-weight: bold;
                    }

                    .title{
                        font-size: 1rem;
                        font-style:italic;
                        font-weight: bold;
                    }
                `}
            </style>
        </div>
    )
}
